            Assert.Equal(MolarMaximumRateOfReaction.Zero, quantityInfo.Zero);
            Assert.Equal("MolarMaximumRateOfReaction", quantityInfo.Name);
            Assert.Equal(QuantityType.MolarMaximumRateOfReaction, quantityInfo.QuantityType);

            var units = EnumUtils.GetEnumValues<MolarMaximumRateOfReactionUnit>().Except(new[] {MolarMaximumRateOfReactionUnit.Undefined}).ToArray();
            var unitNames = units.Select(x => x.ToString());

            // Obsolete members
            Assert.Equal(units, quantityInfo.Units);
            Assert.Equal(unitNames, quantityInfo.UnitNames);
        }

