        }

        [Fact]
        public void ComparisonOperators()
        {
            MolarMaximumRateOfReaction oneMolePerSecondPerGram = MolarMaximumRateOfReaction.FromMolesPerSecondPerGram(1);
            MolarMaximumRateOfReaction twoMolesPerSecondPerGram = MolarMaximumRateOfReaction.FromMolesPerSecondPerGram(2);

            Assert.True(oneMolePerSecondPerGram < twoMolesPerSecondPerGram);
            Assert.True(oneMolePerSecondPerGram <= twoMolesPerSecondPerGram);
            Assert.True(twoMolesPerSecondPerGram > oneMolePerSecondPerGram);
            Assert.True(twoMolesPerSecondPerGram >= oneMolePerSecondPerGram);

            Assert.False(oneMolePerSecondPerGram > twoMolesPerSecondPerGram);
            Assert.False(oneMolePerSecondPerGram >= twoMolesPerSecondPerGram);
            Assert.False(twoMolesPerSecondPerGram < oneMolePerSecondPerGram);
            Assert.False(twoMolesPerSecondPerGram <= oneMolePerSecondPerGram);
        }

