        [Fact]
        public void ToString_SFormat_FormatsNumberWithGivenDigitsAfterRadixForCurrentCulture()
        {
            var oldCulture = CultureInfo.CurrentUICulture;
            try
            {
                CultureInfo.CurrentUICulture = CultureInfo.InvariantCulture;
                Assert.Equal("0.1 mol/s/g", new MolarMaximumRateOfReaction(0.123456, MolarMaximumRateOfReactionUnit.MolePerSecondPerGram).ToString("s1"));
                Assert.Equal("0.12 mol/s/g", new MolarMaximumRateOfReaction(0.123456, MolarMaximumRateOfReactionUnit.MolePerSecondPerGram).ToString("s2"));
                Assert.Equal("0.123 mol/s/g", new MolarMaximumRateOfReaction(0.123456, MolarMaximumRateOfReactionUnit.MolePerSecondPerGram).ToString("s3"));
                Assert.Equal("0.1235 mol/s/g", new MolarMaximumRateOfReaction(0.123456, MolarMaximumRateOfReactionUnit.MolePerSecondPerGram).ToString("s4"));
            }
            finally
            {
                CultureInfo.CurrentUICulture = oldCulture;
            }
        }

        [Fact]
        public void ToString_SFormatAndCulture_FormatsNumberWithGivenDigitsAfterRadixForGivenCulture()
        {
            var culture = CultureInfo.InvariantCulture;
            Assert.Equal("0.1 mol/s/g", new MolarMaximumRateOfReaction(0.123456, MolarMaximumRateOfReactionUnit.MolePerSecondPerGram).ToString("s1", culture));
            Assert.Equal("0.12 mol/s/g", new MolarMaximumRateOfReaction(0.123456, MolarMaximumRateOfReactionUnit.MolePerSecondPerGram).ToString("s2", culture));
            Assert.Equal("0.123 mol/s/g", new MolarMaximumRateOfReaction(0.123456, MolarMaximumRateOfReactionUnit.MolePerSecondPerGram).ToString("s3", culture));
            Assert.Equal("0.1235 mol/s/g", new MolarMaximumRateOfReaction(0.123456, MolarMaximumRateOfReactionUnit.MolePerSecondPerGram).ToString("s4", culture));
        }


